import React from 'react';
import logo from './logo.svg';
import './App.css';

var helloWorld = 'Welcome to the Road to Learn React';

function App() {
  return (
    <div className="App">
      <h2>{helloWorld}</h2>
    </div>
  );
}

export default App;
